import IndexImageStyles from './styles/IndexImageStyles';

export default function IndexImage({ catagory }) {
  return (
    <IndexImageStyles>
      <div className="image">
        <div
          className="overlay"
          href="http://localhost:7777/producs"
        >
          <h1 id={catagory}>{catagory}</h1>
        </div>
      </div>
    </IndexImageStyles>
  );
}

// <h1>{catagory}</h1>
